import React from "react";
import "./View.css";

function View({ contents, filteredContent }) {
  return (
    <div className="View">
      <div className="View__item">
        {contents &&
          contents.map((el) => (
            <li className="View__list" key={el.id}>
              <div className="username">{el.username}</div>
              <div className="title">{el.title}</div>
              <div className="title">{el.content}</div>
              <div className="createAt">{el.createdAt}</div>
            </li>
          ))}
      </div>
      <div className="View__btns">
        <button className="수정">수정</button>
        <button className="삭제">삭제</button>
      </div>
    </div>
  );
}

export default View;
